import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import CrudButtons from "./CrudButtons";
import CreatePage from "./CreatePage";  // Página de crear
import ReadPage from "./ReadPage";      // Página de leer
import UpdatePage from "./UpdatePage";  // Página de actualizar
import DeletePage from "./DeletePage";  // Página de eliminar
import "./App.css";

function App() {
    return (
        <Router>
            <div style={pageStyle}>
                <h1 style={headerStyle}>Vida Silvestre</h1>
                <CrudButtons />
                <Routes>
                    <Route path="/create" element={<CreatePage />} />
                    <Route path="/read" element={<ReadPage />} />
                    <Route path="/update" element={<UpdatePage />} />
                    <Route path="/delete" element={<DeletePage />} />
                </Routes>
            </div>
        </Router>
    );
}

const headerStyle = {
    marginBottom: "2rem",
    color: "white", // Asegura que el título también sea blanco
};

const pageStyle = {
    backgroundColor: "#007BFF", // Azul de fondo
    minHeight: "100vh", // Asegura que el fondo cubra toda la pantalla
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    padding: "2rem",
    color: "white", // Color blanco para el texto general
};

export default App;
